script: |
  super -f text -I q10058.sql | sort > q10058.out

inputs:
  - name: q10058.sql
    data: |
      SELECT * FROM tab1 WHERE col1 * + ( 17 ) - + 4 NOT BETWEEN col0 * - col1 AND ( + col0 * + CAST ( - col0 / 43 AS REAL ) );
  - name: tab1

outputs:
  - name: q10058.out
    data: |
      51	14	96
      85	5	59
      91	47	68
